import Mock from 'mockjs'

let photo = []
const count = 50
const imgUrls = [
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ9eVK91QlTERXPyzpQoburx85ijWETnr4PC_3Xr0r_oXQbrNOq',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTTEMiBp3sRTcppUytZpHFExLaIPjBnOxlHOHhtGwTxJiLDD1QUZQ',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRWUpf0qmHGwFg6Vnadtn7Tnmltnrr0ncQayjBIY57Ipb8Yp7k56A',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSwyfOhr4iT9HTWR7U4g_4d2VHYiKTBb56V52u4w3NGrJ66VMW6OQ',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSsAXCtSroBJZCDF5N0Uei5RfiK9svyK9FYc2lX5fxK0J7Tw9d-lg',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRp5Ez0BDA2-Yv6yCCAFvB_bOEmuWbZltTlKq7I7VGaklxUTHL7',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTycVdXEhjZ_Io--ScpamBNOQf8AkyFYpXn5vMUG8DSi7SXinwClA',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSW_Sf50C91CA1lyDXOwhwkwtGP8A3ogf5Hkt05QBqXqU6S2yFn'
]

for (let index = 0; index < count; index++) {
  const url = imgUrls[Math.floor(Math.random() * imgUrls.length)]
  photo.push(
    Mock.mock({
      contributor: '@name',
      createtimestamp: '@date',
      id: '@id',
      masked: '@boolean',
      urls: [
        url
      ]
    })
  )
}

export default {
  getPhoto () {
    return photo
  }
}
